import React from 'react';
import '../App.css'


function Navbar() {
    return (

             <nav>
        <h2 id="nav-title">THE PLANETS</h2>
        <ul>
            <li><Link to="">MERCURY</Link>MERCURY</li>
            <li>VENUS</li>
            <li>EARTH</li>
            <li>MARS</li>
            <li>JUPITER</li>
            <li>SATURN</li>
            <li>URANUS</li>
            <li>NEPTUNE</li>
        </ul>
    </nav>
    );
}

export default Navbar;
